import React from 'react';

export default function home(props) {
  return (
    <div className='container'>
      {props.questions.map((item) => {
        return (
          <div className='title'>
            {item.theme}
            <span>
              {item.questions.map((question) => {
                return (
                  <span
                    onClick={() => {
                      console.log(question.text);
                    }}
                  >
                    {question.points}
                  </span>
                );
              })}
            </span>
          </div>
        );
      })}
    </div>
  );
}
